import React, { Component } from 'react'
import ChooseTeacherCard from '../components/ChooseTeacher/ChooseTeacherCard'
import BasePageWithCard from './BasePageWithCard';
export default class ChooseTeacher extends Component {
  render() {
    const studentData = this.props.studentData
    return (
        <BasePageWithCard isAuthenticated={true} data={studentData}>
        <ChooseTeacherCard/>
          </BasePageWithCard>
    )
  }
}
